import React, { useRef, useEffect } from 'react';
import CountUp from 'react-countup'; // Assuming you've imported react-countup

function Counter({end, duration}) {
  const countUpRef = useRef(null);

  useEffect(() => {
    // You might want to add logic here to start the count animation
    if (countUpRef.current) {
      countUpRef.current.start(); // This starts the count animation
    }
  }, []);

  return (
    <div>
      {/* Example of using CountUp */}
      <CountUp start={0} end={end} duration={duration} ref={countUpRef} />
    </div>
  );
}

export default Counter;
